import Card from '../UserInterface/Card';
import { useState } from 'react';
import { Redirect, Link } from "react-router-dom";

function Modal(){
    const SignInviaMicro = () => {
        // <Navigate to="/microsoft" />
        // sign up via microsoft
    }
    return (
        <Card>
            <div className={classes.modal}>
                <button className={classes.btn} onClick={SignInviaMicro}>Login using your IITG outlook account</button>
                <Link to="/signup">
                    <button className={classes.btn}>Create your Account</button>
                </Link>
            </div>
        </Card>
    );
}
 
export default Modal;
